import { useTypewriter, Cursor } from 'react-simple-typewriter'



const type = () => {
    const { sergio } = useTypewriter({
        words: ['Sergio',],
        loop: {},
    })
    return (
        <div>
            <span>{sergio}</span>
            <Cursor />
        </div>
    )
}

export default type
